import React from "react";

const ListItem = ({ dish }) => {
    return (
        <div>
            <div>
            <img src={dish.image} alt="this is beef image" />
            </div>
            <h3>{dish.name} - {dish.currency}  {dish.price}</h3> 
            <p><em>{dish.description}</em></p>
        </div>
    )
}

export default ListItem;
